var app = angular.module('player', []);

var players = [
    new Player(1, 'Rod Hall', 'Male', '07/15/1985', 'Loose', null, 'rodhall@hotmail.co.uk', 'Description', 'data:image/jpeg;base64,'),
    new Player(2, 'Graham Parris', 'Male', '05/10/1980', 'Loose', null, null, 'Description', 'data:image/jpeg;base64,'),
    new Player(3, 'Sean "Twiggy" Twig', 'Male', '01/01/1950', 'Loose', '01733 354432', 'example@foo.com', 'Description', 'data:image/jpeg;base64,'),
    new Player(4, 'Dave "Shit Lips" Smith', 'Male', '10/08/1940', 'Loose', null, null, 'Description', 'data:image/jpeg;base64,')
];

app.controller('PlayerController', function ($scope) {
    $scope.mode = 'list';
    $scope.players = players;
    $scope.addPlayer = function (player) {
        $scope.players.push(new Player(player.id, player.name, player.sex, player.dob, player.style, player.telephone, player.email, player.description, player.image));
        $scope.mode = 'list';
    };
})

app.filter('ageFilter', function () {
    function calculateAge(dateString) { // birthday is a date
        var today = new Date();
        var birthDate = new Date(dateString);
        var age = today.getFullYear() - birthDate.getFullYear();
        var m = today.getMonth() - birthDate.getMonth();
        if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
            age--;
        }
        return isNaN(age) ? null : age;
    }

    return function (birthdate) {
        return calculateAge(birthdate);
    };
});

app.directive('playerDisplay', function () {
    return {
        restrict: 'E',
        templateUrl: '../templates/player/player-display.html'
    }
});

app.directive('playerInput', function () {
    return {
        restrict: 'E',
        templateUrl: '../templates/player/player-input.html'
    }
});

app.directive('playerDisplayList', function () {
    return {
        restrict: 'E',
        templateUrl: '../templates/player/player-display-list.html'
    }
});

function Player(id, name, sex, dob, style, telephone, email, description, image) {
    this.id = id;
    this.name = name;
    this.sex = sex;
    this.dob = dob;
    this.style = style;
    this.telephone = telephone,
    this.email = email,
    this.description = description;
    this.image = image == null ? $('#player-image').attr('src') : image;
    this.info = this.name + ' - ' + this.sex + ' - ' + this.age;
}

function loadImage(input) {
    if (input.files && input.files[0]) {
        var reader = new FileReader();

        reader.onload = function (e) {
            $('#player-image').attr('src', e.target.result);
        };

        reader.readAsDataURL(input.files[0]);
    }
}
